import React, { useState } from 'react'

function InteractiveWindow() {
    const [length, setLength] = useState(6);
  return (
    <div className='custom-shadow flex flex-col justify-between items-center p-5 custom-bg rounded-2xl w-full'>
        <div className="flex justify-between w-full items-center">
            <span className="text-2xl text-white">Password Length</span>
            <span className='text-yellow-400 text-2xl'>{length}</span>
        </div>
    </div>
  )
}

export default InteractiveWindow
